import { jsPDF } from "jspdf";
var font =
  '';
var callAddFont = function () {
  this.addFileToVFS("NotoSerifTelugu-VariableFont_wght-normal.ttf", font);
  this.addFont(
    "NotoSerifTelugu-VariableFont_wght-normal.ttf",
    "NotoSerifTelugu-VariableFont_wght",
    "normal"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
export default font;
